import './App.css';
import {BrowserRouter, Routes, Route, useParams} from 'react-router-dom';
import Footer from './components/footer/Footer';
import Navbar from './components/navbar/Navbar';
import Shop from './pages/Shop';
import ShopCategory from './pages/ShopCategory';
import Product from './pages/Product';
import Cart from './pages/Cart';

import dogs_banner from './components/assets/frontend_assets/dogs_banner.png';
import cats_banner from './components/assets/frontend_assets/cats_banner.png';
import birds_banner from './components/assets/frontend_assets/birds_banner.png';
import ShopBrand from './pages/ShopBrand'; // Import the new component

function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Shop />} />
          <Route path='/dogs' element={<ShopCategory banner={dogs_banner} category="dogs" />} />
          <Route path='/cats' element={<ShopCategory banner={cats_banner} category="cats" />} />
          <Route path='/birds' element={<ShopCategory banner={birds_banner} category="birds" />} />
          <Route 
  path='/brand/:brandName' 
  element={
    <ShopCategory 
      brand={useParams().brandName} 
    />
  } 
/>

          <Route path='/product' element={<Product />}>
            <Route path=':productId' element={<Product />} />
          </Route>
          <Route path='/cart' element={<Cart />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
